define({"topics" : [{"title":"Disassociating TA and TFS test cases ","shortdesc":"\n                     <p class=\"shortdesc\">When you no longer want to keep the association, you can disassociate <span class=\"ph\">TestArchitect</span> tests from TFS tests.\n                     </p>\n                  ","id":"task_zbj_ztb_wbb","href":"TA_Help\/Topics\/ug_MTM_disassociate.html","menu": {"hasChildren":false,},"tocID":"task_zbj_ztb_wbb-d46e25131","topics":[]},{"title":"Creating matching custom fields","shortdesc":"\n                     <p class=\"shortdesc\">User-defined fields in <span class=\"ph\">TestArchitect</span> are             automatically mapped to TFS custom fields when the names and data types             match.\n                     </p>\n                  ","id":"task_rvw_3kg_sq","href":"TA_Help\/Topics\/ug_MTM_matching_custom_fields.html","menu": {"hasChildren":false,},"tocID":"task_rvw_3kg_sq-d46e25145","next":"task_rvw_3kg_sq-d46e25145",},{"title":"Upgrading build assemblies of the TA plug-in","shortdesc":"\n                     <p class=\"shortdesc\">When the TA-TFS plug-in is installed, its information is stored in build assembly files.     Whenever you upgrade the plug-in\n                        to a newer version, the assembly files also need to be     upgraded, by either manual or automatic means. \n                     </p>\n                  ","id":"concept_nnw_g5h_sq","href":"TA_Help\/Topics\/ug_MTM_upgrading_assemblies.html","menu": {"hasChildren":false,},"tocID":"concept_nnw_g5h_sq-d46e25173","next":"concept_nnw_g5h_sq-d46e25173",},{"title":"Switching to a different TFS account","shortdesc":"\n                     <p class=\"shortdesc\">When making queries to a TFS server from a <span class=\"ph\">TestArchitect</span> repository, you need a TFS account to authenticate the query. If necessary, you have the         option of switching from\n                        the current TFS account to a different account.\n                     </p>\n                  ","id":"task_rsg_mdd_tq","href":"TA_Help\/Topics\/ug_MTM_switching_TFS_account.html","menu": {"hasChildren":false,},"tocID":"task_rsg_mdd_tq-d46e25206","topics":[]},{"title":"Displaying test results in a browser","shortdesc":"\n                     <p class=\"shortdesc\"><span class=\"ph\">TestArchitect</span> test results         may be opened in a web browser on any machine. <span class=\"ph\">TestArchitect</span> need not be installed to view the         results.\n                     </p>\n                  ","id":"task_w1j_drb_qs","href":"TA_Help\/Topics\/ug_MTM_open_result_web.html","menu": {"hasChildren":false,},"tocID":"task_w1j_drb_qs-d46e25220","topics":[]},{"title":"Specifying a value for TFS <span class=\"ph uicontrol\">build number</span> field\n                  ","shortdesc":"\n                     <p class=\"shortdesc\">Within TFS, for each test run that is recorded, a run build number must be supplied.     This allows you to find the test\n                        runs quickly based on the build number.\n                     </p>\n                  ","id":"concept_a5g_xpb_qs","href":"TA_Help\/Topics\/ug_MTM_build_number_field.html","menu": {"hasChildren":false,},"tocID":"concept_a5g_xpb_qs-d46e25236","topics":[]},{"title":"TA-TFS Extensibility","shortdesc":"\n                     <p class=\"shortdesc\">The TA-TFS Extensibility feature offers you, by means of <span class=\"ph\">TestArchitect</span>-supported API methods, the ability to extend and   customize the environment for executing automated test cases.\n                     </p>\n                  ","id":"concept_qdr_wgf_rs","href":"TA_Help\/Topics\/ug_MTM_Extensibility.html","menu": {"hasChildren":false,},"tocID":"concept_qdr_wgf_rs-d46e25250","next":"concept_qdr_wgf_rs-d46e25250",},{"title":"<span class=\"keyword wintitle\">TestArchitect Execution</span> dialog box\n                  ","shortdesc":"\n                     <p class=\"shortdesc\">The <span class=\"keyword wintitle\">TestArchitect Execution</span> dialog box is invoked, when <span class=\"ph\">TestArchitect</span> automated runs are executed via         MTM.\n                     </p>\n                  ","id":"reference_xv5_5vf_ybb","href":"TA_Help\/Topics\/ug_TestArchitect_execution_dialog.html","menu": {"hasChildren":false,},"tocID":"reference_xv5_5vf_ybb-d46e25343","topics":[]}]});